// src/pages/UpdatesPage.jsx
import React from 'react';
import { Box, Typography, Card, CardHeader, CardContent } from '@mui/material';

function UpdatesPage() {
  return (
    <Box>
      <Typography variant="h5" gutterBottom>
        Güncellemeler
      </Typography>

      <Card>
        <CardHeader title="Sistem & Firewall Güncellemeleri" />
        <CardContent>
          <Typography>
            Firewall ve sistem güncellemeleri burada listelenecektir. Örneğin:
          </Typography>
          <ul>
            <li>Son Yama Tarihi: 2025-04-10</li>
            <li>Sürüm: NetGate FW 2.1.0</li>
            <li>Otomatik Güncelleme Durumu: Açık</li>
          </ul>
          <Typography variant="body2" color="text.secondary">
            Güncelleme detayları, değişiklik günlüğü vb. eklenebilir.
          </Typography>
        </CardContent>
      </Card>
    </Box>
  );
}

export default UpdatesPage;
